@jonasholmdk @HenrikDyhHansen Jeg tænker ikke blot på skade på dyr og mennesker men især også psykisk for især dyr. 

Hunde og katte i mange danske hjem bliver bedøvet med medicin eller går skræmte rundt imens folk synes at det er sjovt at fyrer krudt af.

Tænker også på de mennesker som har oplevet krig.
